Comment:
First off dont read comments or watch anything about this movie... just go watch it and enjoy it. The more you know, it will ruin the experience. 





Spoilers; 

Okay so im athiest, don't care much about religion.... but this is a great movie about God, Adam and Eve. Afterall the bible is just a book like any other one. The story is similar to it without any over the top b.s other religious movies would bring to it. Its a good story simple very scary. It will feel like you're there. I love earth "mother" earth, so it is also relatable to our real time and world. How things are now ect. Dont just focus on the religion part just think of it as a whole. Good movie regardless.
